INSERT INTO `item` VALUES (1,'Форма',NULL,34,NULL,'weadfsehtgjhm','<p>ФОРМА Вашей компании - это тысячи полезных функций для <strong>систематизации бизнеса, повышения </strong>показателей <strong>продаж</strong> и <strong>дисциплины</strong>. И конечно для <strong>подготовки</strong> малого бизнеса к <strong>росту</strong> (а для малого и крупного бизнеса, готового к росту, наша команда проектирует дорогие индивидуальные решения и предоставляет экспертные услуги). </p><p>Здесь, в разделе регламентов, <strong>Вы научитесь эффективно управлять системой</strong> и изменять её под свой бизнес. Это не пустой текст - Вы сразу же будете <strong>на практике</strong> строить и управлять Вашей индивидуальной системой благодаря <strong>уникальным функциям</strong> ФОРМЫ. </p><p>Раздел регламента - это <strong>инструмент управления компанией</strong> и внедрения в компанию <strong>систем автоматизации</strong>. Даже если у Вас 0 опыта - Вы постепенно освоите все возможности. Если у Вас есть опыт - Вы очень быстро разберетесь. В любом случае, мы поможем.\r\n</p><p>Регламенты - это большие информационные блоки. Каждый регламент состоит из разделов - конкретного текста, объясняющего возможности системы. Внутри разделов могут быть использованы специальные кнопки, нажатие на которые позволяет посмотреть реальную функциональность системы в маленьком компактном окошке. Это удобно. Давайте приступим!qwdefgryjilk.l</p>',NULL,1),(98,'Управление',NULL,34,NULL,'','<p>Данный раздел предназначен для менеджеров, директоров и управленцев. Независимо от количества людей в Вашем бизнесе (даже если это только Вы) - это удобный инструмент контроля, планирования и мониторинга деятельности Вашего бизнеса. Данный тип систем для управления называется АСУП - Автоматизированная система управления предприятием. Система ФОРМА максимально упрощает управление для малого бизнеса. А для проектирования сложных систем обратиться в компанию ingello (разработчик ФОРМЫ).</p>',NULL,1),(99,'Продукты',NULL,34,NULL,'','<p>Бизнес строится на извлечении прибыли при продаже продукта и\\или оказании услуги. И данный раздел Вам в этом поможет. Он удобен для описания каталога продуктов или услуг. Для продвинутых пользователей доступен конструктор, который позволит создавать сложные формы добавления продуктов в каталог. Об этом позже.  </p>',NULL,1),(100,'Учет ресурсов',NULL,34,NULL,'','<p>Данный раздел поможет<strong> вести учет </strong>объектов в Вашей собственности. Это могут быть просто любые вещи. Например - столы, стулья, инструменты, компьютеры. Так-же это могут быть продукты, которые Вы продаёте. Более того: Вы сможете управлять целой сетью складов, производить операции <strong>закупок, транзитов и инвентаризации,</strong> учитывать <strong>накладные расходы, налоги</strong> и многое другое. </p><p>Системы такого класса называются <strong>WMR</strong> (Warehouse Management System - Система Управления Складом), а так-же имеются элементы систем типа <strong>ERP</strong> - (Enterprise Resource Planning - планирование ресурсов предприятия). </p>',NULL,1),(101,'Продажи',NULL,34,NULL,'','<p>При проектировании системы ФОРМА, архитектор был убежден, что <strong>продажи</strong> - это самая важная часть любой бизнес-системы. Конечно же, всё работает в комплексе, и важны все отделы и их функции.</p><p> Но цель системы ФОРМА - это вывести бизнес <strong>на новый уровень</strong>, навести порядок в взаимоотношениях с клиентами. Все необходимые функции Вы найдёте тут. </p><p>Мы расскажем, как планировать <strong>переговоры</strong>, как <strong>обслуживать</strong> и опрашивать <strong>клиентов</strong>, как нарабатывать <strong>клиентскую базу</strong> и <strong>историю</strong> по каждому клиенту индивидуально, как разработать свою собственную <strong>стратегию</strong> <strong>продаж</strong> и <strong>автоматизировать</strong> их. </p><p>Системы такого типа называются популярным словом <strong>CRM</strong>  (Customer Relationship Management - <strong>Система управления взаимоотношениями с клиентами).</strong></p>',NULL,1),(102,'Кадры',NULL,34,NULL,'','<p>Даже если Вы пока один - вероятно, это не на долго. Для того, чтобы бизнес рос и распространяется, как франшиза, как вирус, - <strong>нужны кадры</strong>. Они, как говорится, “решают”. Позже мы поговорим как построить и <strong>систематизировать</strong> отдел кадров, как благодаря <strong>автоматизации</strong> избежать ненужной волокиты при <strong>найме</strong> и как перестать обучать кадровиков, а вместо этого сделать так, чтобы они обучали Вашу систему. </p><p>Отдел стоит на трёх китах - <strong>найм</strong>, <strong>вакансия</strong> и <strong>кадр</strong>. В прогрессивных областях конкуренция происходит не за клиентов, а за специалистов. И эту тенденцию важно не пропустить. </p><p>Системы такого класса называются <strong>HRM</strong> (Human Resource Management - <strong>Управление Человеко-Ресурсом</strong>). </p>',NULL,1),(117,'Экспертные системы',NULL,34,NULL,'','<p>Данный класс систем предназначен для <strong>продвинутых</strong> компаний или предприятий, которые создаются на базе <strong>хорошего финансирования</strong> с целью <strong>скорейшего роста</strong>. Это не просто системы, <strong>это возможности</strong>. И в заключительной части мы познакомим Вас с возможностями ИТ компании ingello а также с её наработками. </p><p>Система ФОРМА - это <strong>бесплатный инструмент </strong>для компаний, который отлично подойдёт <strong>на ранних этапах развития</strong>, но планировать будущие разработки всегда лучше заранее и мы с удовольствием в этом поможем. </p><p>Поговорим о системах класса <strong>E-Commerce</strong> и <strong>Marketplace</strong> - для международной торговли, о системах <strong>PMS</strong> для управления проектами и командами, о системах <strong>HIS</strong> для медицинского обслуживания, об <strong>API</strong> системах и базах данных, про <strong>IOT</strong> - интернет вещей и умные дома, про большие данные и искусственный интеллект и даже про квантовую механику! </p><p>Спасибо, что изучаете регламент. Теперь перейдем к конкретной и формальной части. </p>',NULL,1),(118,'Категории продуктов',NULL,153,NULL,'','',NULL,1),(119,'Форма продукта',NULL,153,NULL,'','',NULL,1),(120,'Каталог',NULL,153,NULL,'','',NULL,1),(121,'Склад',NULL,154,NULL,'','<p>Основные операции</p>',NULL,1),(122,'Закупки',NULL,154,NULL,'','<p>Закупки (они же - поставки)</p><p>откуда куда</p><p>оприходование доставка</p><p>товарные позиции</p><p>накладные расходы</p><p>сумма</p><p>ожидаются</p>',NULL,1),(123,'Перемещение',NULL,154,NULL,'','<p>Закупки (они же - поставки)</p><p>откуда куда</p><p>оприходование доставка</p><p>товарные позиции</p><p>накладные расхоы</p><p>сумма</p><p>ожидаются</p>',NULL,1),(124,'Инвентаризация',NULL,154,NULL,'','',NULL,1),(132,'Воронка кадров',NULL,156,NULL,'','',NULL,1),(133,'Вакансии',NULL,156,NULL,'','',NULL,1),(134,'Кадры',NULL,156,NULL,'','',NULL,1),(135,'Проекты',NULL,156,NULL,'','',NULL,1),(136,'Процесс найма',NULL,156,NULL,'','',NULL,1),(137,'Должностные инструкции',NULL,156,NULL,'','',NULL,1),(138,'Показатели',NULL,157,NULL,'','<p>Это пульс Вашей компании. На ней отображаются основные показатели Вашей компании. Обычно эту панель принято называть “Дэшборд”.  </p><p>Дэшборд состоит из виджетов - специальных блоков, в которых могут отображаться графики, таблицы другие формы данных. </p><p>К примеру, в ФОРМУ по умолчанию включен миниатюрный календарь, список сотрудников, состояние процессов найма, виджет воронки продаж, виджет статистики продаж по складам, виджет основных показателей и многое другое. Все эти функции мы рассмотрим в соответствующих разделах. </p><p>В каждом виджете есть специальная кнопка с тремя линиями, в которой есть основные функции виджета. Пока просто запомните, что такая есть. Она для супер-продвинутых пользователей или для тех, кто прочитал все регламенты. </p><p>Вы можете определить, какие данные Вам важнее видеть. Сейчас, в качестве первого практического взаимодействия, попробуем настроить дэшборд на Ваш вкус. Для этого мы будем перетаскивать виджеты курсором мыши в нужное Вам положение. Зажмите левую кнопку мыши на названии виджета и перемещайте его. Если виджет Вам не нужен - перетяните его в верхнюю панель (позже сможете вернуть). Если виджет Вам нужен - перетаскивайте его повыше. Если не важен - по ниже. Также можно свернуть виджет, нажав на кнопку “-”.</p><p><strong>ПОСМОТРИТЕ НА ДЭШБОРД,</strong> чтобы начать экспериментировать с панелью.</p><p>(Настраивать дэшборд можно только на большом экране)</p>',NULL,1),(139,'Регламент',NULL,157,NULL,'','<p>Регламенты нужны для того, чтобы написать правила работы компании и пересечь эти правила с функциями системы. Это очень мощная функция системы!</p><p>Интересный факт: Вы сейчас читаете регламент. Но его написал я, Олег, - архитектор данной системы, других систем для малого бизнеса и ряда других коммерческих и некоммерческих систем. Но никто не знает Ваш бизнес лучше, чем Вы. И потому в будущем Вы полностью перепишете регламенты Вашей компании. Задача команды ingello - предоставить бесплатные функции на первое время, до начала стадии активного роста бизнеса, на стадии выживания. </p>\r\n<p>Регламент - это важнейший набор правил, определяющий поведение компании. Но это не просто текст. Это мультифункциональный текст, в который можно зашить любую из тысяч функций системы. А давайте я прямо сейчас покажу, как всё это устроено внутри.</p>\r\n<p>Важно: Это может оказаться сложно для новичков, потому Вы можете пропустить этот раздел и вернуться к нему позже. Либо же будьте готовы попробовать несколько раз, пока не получится. А получится полюбому. </p>\r\n<p>Начнем! Для начала, нажимайте эту кнопку, осмотритесь и закройте окно СМОТРЕТЬ СПИСОК РЕГЛАМЕНТОВ<a href=\"https://forma.ingello.com/core/regularity/settings\">https://forma.ingello.com/core/regularity/settings</a></p><p>Видели этот список? Это список регламентов, один из которых Вы сейчас читаете. А самое интересно это то, что в Вашей власти его изменить! Давайте договоримся пока ничего не удалять, чтобы не нарушить программу. Но давайте что-нибудь добавим новое!</p>\r\n<p>Чтобы не добавлять что-попало, давайте создадим список должностных обязанностей. </p><p>Тогда, регламент будет называться “Должностные обязанности”, а его разделы (пункты) будут называться “Обязанности менеджера”, “Обязанности продавца”, “Обязанности администратора”. Нажимая на эти пункты мы будем видеть текст, в котором будут описаны эти обязанности, к примеру “В обязанности продавца входит приветствовать клиента, консультировать его согласно следующим правилам….”. Ну, Вы поняли, надеюсь. </p><p>Итак, попробуем добавить регламент. Вы можете нажать на предыдущую кнопку и добавить новый регламент в список.</p><p>Или просто нажмите на эту кнопку и дайте название “Должностные обязанности” своему собственному регламенту СОЗДАЙТЕ СВОЙ РЕГЛАМЕНТ</p>\r\n<p>Верю, что у Вас всё получилось. Но давайте это проверим. Зайдите в РЕГЛАМЕНТЫ <a href=\"https://forma.ingello.com/core/regularity\">https://forma.ingello.com/core/regularity</a> или в ПРЕЗЕНТАЦИЮ или же просто обновите страницу, на которой Вы сейчас находитесь. Заметили? Теперь в регламентах появился Ваш собственный регламент с названием, которое Вы написали!</p>\r\n<p>Далее нужно наполнить его разделами. То есть, к примеру, должен получится список обязанностей для разных ролей Вашего бизнеса.  Давайте это сделаем. ОТКРОЙТЕ СПИСОК РЕГЛАМЕНТОВ И РАЗДЕЛОВ<a href=\"https://forma.ingello.com/core/regularity\">https://forma.ingello.com/core/regularity</a></p><p>Сверху (в ряд) располагаются вкладки всех регламентов и среди них должен быть Ваш только что созданный. Нажмите на него и увидете кнопку “Добавить пункт”. Клацайте на неё. </p>\r\n<p>В появившемся окне нужно как минимум написать название раздела и его описание. Можете еще выбрать цвет раздела. Если следовать нашему примеру, - то в название пишите должность, а в описание - обязанности этой должности. И нажимайте кнопку “Добавить” внизу формы. </p>\r\n<p>Повторите это действие несколько раз, чтобы наполнить регламент разделами.</p><p>А в следующем разделе мы поговорим о более сложном применении регламентов - о связывании их с функциями системы. И разберемся, что за непонятные кнопочки были справа при создании регламента. </p>',NULL,1),(140,'Регламент для продвинутых',NULL,157,NULL,'','<p>Теперь поговорим про беспрецедентно мощную функцию системы ФОРМА, которая способна создать из Вашего бизнеса точку непреодолимой силы на Вашем рынке. </p><p>Создайте любой новый раздел в РЕГЛАМЕНТЕ <a href=\"https://forma.ingello.com/core/regularity\">https://forma.ingello.com/core/regularity</a>  (как в прошлом пункте), но не спешите сохранять. </p>\r\n<p>Помимо названия, описания и цвета регламента тут есть поле для загрузки картинки (в следующем разделе про презентацию мы поговорим об этом). </p>\r\n<p>Сейчас нас больше интересует правая часть. В ней Вы видите карточки с какими то кнопками. </p>\r\n<p>Вся правая часть делится на разные разделы, Вы могли обратить внимание, что они повторяют пункты меню системы (вот те, разноцветные, слева &lt;&lt;&lt;). Все эти функции (и не только эти) Вы можете использовать и они могут превращаться в вот такие &gt;&gt;&gt; КНОПКИ, при нажатии на которые мы попадаем в определенные разделы системы. </p><p>Вы программист? Скорее всего, Вы думаете, что не программист. Но теперь Вы им станете. Да и кто вообще не программист после 2020 года? =)</p>\r\n<p>На каждой карточке с функцией есть 2 кнопки. Первая кнопка - это пример кнопки, которую мы можем “зашить” в текст. Нажмите на неё и всё поймёте. Вы их уже видели в регламентах. </p>\r\n<p>Вторая кнопка - это волшебный код. Нажмите на неё и увидите этот код. Просто скопируйте этот код (самый интересный способ - трижды кликнув на код левой кнопкой мыши и нажав правой кнопкой). Теперь вставьте этот код в левой части в описание раздела. В ту часть, где Вы хотите, чтобы функция отображалась. К примеру, в должностные обязанности продавца можно было бы скопировать код кнопки списка клиентов или воронки продаж или кнопку создания нового процесса продажи. </p><p>Нажимайте кнопку “добавить” внизу и наслаждайтесь Вашим запрограммированным текстом в Вашем собственном регламенте.</p>\r\n<p>Мне кажется, у Вас уже возникла масса идей, как можно использовать эту черную магию )</p>\r\n<p>Теперь давайте посмотрим раздел “Презентация”, который тесно связан с тем, что мы уже знаем о регламентах. </p>',NULL,1),(141,'Презентация',NULL,157,NULL,'','<p>Презентация - это в общем то те же самые регламенты, но в более… ээм… презентабельной … ээм… ФОРМЕ =)</p>\r\n<p>По сути, это регламенты с картинками в формате типичных презентаций, но всё с теми же встроенными кнопками, которые вызывают специальные функции. </p><p>В отличии от панели настроек регламентов, тут подразумевается возможность последовательного просмотра регламентов в том порядке, в котором Вы их задали. </p><p>Вы просто начинаете с первого регламента и движетесь по разделам, нажимая кнопку “далее”. И так один за другим. </p>\r\n<p>Вероятно, Вы сейчас читаете этот текст из раздела презентации. И конечно же, Вы можете всё тут поменять так, как Вам захочется. </p>\r\n<p>Зайдите  в РЕГЛАМЕНТЫ <a href=\"https://forma.ingello.com/core/regularity\">https://forma.ingello.com/core/regularity</a> и добавитье новый раздел или отредактируйте существующий (кнопка карандаша на блоке раздела).</p><p>При создании или редактировании раздела Вы можете добавлять картинку. Это должны быть большая картинка, она отобразится на пол экрана в презентации.</p><p>Важно поставить галочку “публичный” в разделе, а также убедиться что такая же галочка установлена в регламенте. Для этого отредактируйте свой регламент в списке  НАСТРОЙКИ РЕГЛАМЕНТОВ.  </p>\r\n<p>Теперь Вы можете зайти в ПРЕЗЕНТАЦИИ и посмотреть, как это выглядит. </p><p>Вы можете также создавать презентации для Ваших клиентов и делиться с ними ссылкой на презентацию. Но важно понимать, что функции системы (кнопки) не будут для них работать. </p>',NULL,1),(142,'Календарь',NULL,157,NULL,'','<p>Данный раздел нужен для того, чтобы планировать время и не только. </p><p>(календарем удобнее всего пользоваться на большом экране с помощью компьютерной мыши)</p>\r\n<p>Календарь можно смотреть в разрезе месяца, недели, дня или повестки дня. </p><p>В верхней части календаря Вы можете видеть кнопки, которые переключают эти режимы.</p>\r\n<p>Месяц - это 28-31 день “как на ладони”, в котором отображаются события. </p><p>Вы можете кликнуть на любой из дней и появится окошко, в котором Вы можете создать название и описание Вашего календарного события. </p>\r\n<p>Неделя отличается тем, что тут мы видим 7 колонок, в которых видны не только сами события, но и их продолжительность. Вы можете перетягивать события с места на место или же тянуть их за нижний край, изменяя таким образом их продолжительность. </p>\r\n<p>В режиме дня Вы увидите точно такую же колонку, как в неделе, но по ширине экрана. Подойдёт для детального планирования событий, которые происходят параллельно. </p>\r\n<p>Теперь немного практики. Посмотрите раздел КАЛЕНДАРЬ и попробуйте создавать изменять и перетаскивать события. Это очень просто. </p>\r\n<p>Интересно знать, что в процессе продаж и переговоров с клиентом Вы (а точнее менеджеры отдела продаж) можете использовать функциональность календаря, чтобы планировать встречи или созвоны для отдела продаж. Он встроен прямо в модуль переговоров, это очень удобно! </p>',NULL,1),(143,'События',NULL,157,NULL,'','<p>В системе постоянно происходят различные события: добавили продажу, удалили клиента, изменили регламент… Все эти события строго фиксируются в системе и их можно отслеживать. Давайте на них посмотрим с помощью этой кнопки СМОТРЕТЬ СОБЫТИЯ. События кратко говорят что, когда и в каком отделе произошло. Вы можете переходить прямо из событий к просмотру элементов раздела, нажимая соответствующие кнопки. </p>',NULL,1),(144,'Планирование',NULL,158,NULL,'','',NULL,1),(145,'Электронная коммерция',NULL,158,NULL,'','',NULL,1),(146,'Управление магазином',NULL,158,NULL,'','',NULL,1),(147,'Обработка заявок',NULL,158,NULL,'','',NULL,1),(148,'Здоровье человека',NULL,158,NULL,'','',NULL,1),(149,'Образовательные системы',NULL,158,NULL,'','',NULL,1),(150,'IOT - интернет вещей',NULL,158,NULL,'','',NULL,1),(151,'Генератор платформ',NULL,158,NULL,'','',NULL,1),(152,'Голосовой помощник',NULL,158,NULL,'','',NULL,1),(153,'Мобильные приложения',NULL,158,NULL,'','',NULL,1),(154,'Искусственный интеллект',NULL,158,NULL,'','',NULL,1),(155,'Иммортал Инжелло',NULL,158,NULL,'','',NULL,1);
